            				local AFTER = sheet.danAFT or "1";
            				local HPPer = tonumber(sheet.danVAL) or 0;
            				local ARMOR = tonumber(sheet.valARM) or 0;
            				local MARMOR = tonumber(sheet.valMARM) or 0;
            				local MSG = "";
            				if (BEFORE == "2") then
            					HPPer = math.floor(HPPer*0.5)
