            						HPPer = math.floor(HPPer*0.25)
            					end
            				if (REDUCE == "1") then
            					HPPer = HPPer - ARMOR;
            					MSG ="[ARM]"
            					elseif (REDUCE == "2") then
            						HPPer = HPPer - math.floor(ARMOR/2);
            						MSG ="[ARM/2]"
            					elseif (REDUCE == "3") then
